import styled from "styled-components/native"

export const FirstView6 = styled.View`
flex-direction: row;
align-items: center;
display: flex;
`;

export const BigText5 = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 900;
font-size: 18px;
line-height: 21px;
text-align: center;
color: #C3AD60;
`;

export const SecondView6 = styled.View`
align-items: center;
justify-cntent: center;
margin-top: 58px;
`;
export const PayText = styled.Text`
font-family: 'Roboto';
font-style: normal;
font-weight: 300;
font-size: 18px;
line-height: 21px;
letter-spacing: -0.333333px;
color: #C3AD60;

`;
